import React, { useState, useEffect } from 'react';
import axios from 'axios';

const EntityList = () => {
  const [entities, setEntities] = useState([]);

  useEffect(() => {
    // Fetch entities from backend API when component mounts
    axios.get('http://localhost:8080/entities')
      .then(response => {
        setEntities(response.data);
      })
      .catch(error => {
        console.error('Error fetching entities:', error);
      });
  }, []); // Empty dependency array to run effect only once when component mounts

  return (
    <div>
      <h2>Entities</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            {/* Add additional table headers for other fields if needed */}
          </tr>
        </thead>
        <tbody>
          {entities.map(entity => (
            <tr key={entity.id}>
              <td>{entity.id}</td>
              <td>{entity.name}</td>
              {/* Render additional columns for other fields if needed */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EntityList;
